import React from 'react';
import './App.css';
import { connect } from 'react-redux';
import {nameData} from './actions/formActions'
import { Container } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';

class App extends React.Component{


  classes = () => ({
    root: {
      width: '45%',
      margin: '3%'
    },
    heading:{
      color: '#231903'
    }
  });


  doThing = () => {
    this.props.dispatch(nameData({firstName:'Max', middleName: 'tonk', lastName:'Payne'}))
  }

  render(){
    console.log(this.classes());
    return (
      <Container maxWidth="md">
            <Typography component="div" style={{ backgroundColor: '#ccf0e1', height: '80vh', marginTop:'10vh' }}>

              <form noValidate autoComplete="off">
                <Box 
                display="flex"
                flexDirection="column"
                alignItems="center"
                p={3}
                >
                              <h2>Let's get your Name</h2>

                    <TextField style={this.classes().root} id="outlined-basic" label="First Name" variant="outlined" />
                    <TextField style={this.classes().root} id="outlined-basic" label="Middle Name" variant="outlined" />
                    <TextField style={this.classes().root} id="outlined-basic" label="Last Name" variant="outlined" />
                </Box>
              </form>
            </Typography>
      </Container>
    );
  }
}

function mapStateToProps(state){
  return state;
}

export default connect(mapStateToProps)(App);
